e in Sales screen (Default=DISABLED) -->\n	<!--  <img-width value=\"64\"/> -->\n	<!--  <img-height value=\"48\"/> -->\n\n	<!-- Medium Product button size in Sales screen (Default=ENABLED) -->\n   	<img-width value=\"107\"/>\n	<img-height value=\"60\"/>\n    \n<!-- Large Product button size in Sales screen (Default=DISABLED)-->\n	<!-- <img-width value=\"128\"/> -->\n	<!-- <img-height value=\"96\"/> -->\n<!-- END Product Button Size -->\n\n<!-- Print Receipt (Default=ENABLED) -->\n        <printselected value=\"true\"/>\n\n<!-- ADDITIONAL FEATURES ************************************************* -->\n    <!-- SET Show Change in Cash Sale (Default=ENABLED -->\n        <event key=\"ticket.close\" code=\"Ticket.Close\"/>\n\n    <!-- SET Consolidate Receipt - Multiple ProductID\'s (Default=DISABLED) -->\n        <!-- <event  key=\"ticket.total\" code=\"script.ReceiptConsolidate\"/> -->\n\n    <!-- SET Stock Level Checking (Default=DISABLED) --> \n        <!-- <event key=\"ticket.addline\" code=\"script.StockCurrentAdd\"/> -->\n        <!-- <event key=\"ticket.setline\" code=\"script.StockCurrentSet\"/> -->\n\n        <!-- <event key=\"ticket.change\" code=\"event.change\"/> -->\n        <!-- <event key=\"ticket.addline\" code=\"event.addline\"/> -->\n        <!-- <event key=\"ticket.removeline\" code=\"event.removeline\"/> -->\n        <!-- <event key=\"ticket.setline\" code=\"event.setline\"/> -->\n        <!-- <event key=\"ticket.show\" code=\"event.show\"/> -->\n        <!-- <event key=\"ticket.total\" code=\"script.Event.Total\"/> -->\n        <!-- <event key=\"ticket.total\" code=\"event.total\"/> -->\n        <!-- <event key=\"ticket.close\" code=\"event.close\"/> -->\n        <!-- <event key=\"ticket.close\" code=\"script.printreport\"/> -->\n\n         <taxesincluded value=\"true\"/>\n         <!-- <taxcategoryid value=\"001\"/> -->\n         <!-- <pricevisible value=\"true\" /> -->\n         \n</configuration>'),('69','Ticket.Close',0,'import java.awt.Font;\nimport javax.swing.plaf.FontUIResource;\nimport com.openbravo.pos.payment.PaymentInfo;\nimport javax.swing.JOptionPane;\nimport javax.swing.JDialog;\n\n\nboolean isCash = false;\nString change = \"\";\nPaymentInfo p = ticket.payments.getFirst();\n\nif (\"cash\".equals(p.getName())) {\n    isCash = true;\n    change = p.printChange();\n}\n\n// Get details of the original font before we change it otherwise all dialogboxes will use new settings\nJOptionPane pane = new JOptionPane();\nFont originalFont=pane.getFont();\n\nUIManager.put(\"OptionPane.buttonFont\", new FontUIResource(new Font(\"ARIAL\",Font.PLAIN,20)));\nmessage = \"Change: \" + change;\n JLabel FontText = new JLabel(message);\n FontText.setFont (new Font ( \"Arial\", Font.BOLD, 36) );\n\nif(isCash) {\n     JOptionPane pane = new JOptionPane();\n     pane.setMessage(FontText);\n     pane.setPreferredSize( new Dimension(450,150));\n     JDialog dialog = pane.createDialog(\"Cash payment\");\n    new Thread(new Runnable() {\n         void run() {\n            dialog.show();\n        }\n    }).start();\n}\n\n// Return to default settings\nUIManager.put(\"OptionPane.buttonFont\", new FontUIResource(new Font(originalFont.getName(),originalFont.getStyle(),originalFont.getSize())));'),('69ecc299-a439-4351-91a0-d5dd6ffc30da','LIXA\'s STORE/properties',0,'<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n<!DOCTYPE properties SYSTEM \"http://java.sun.com/dtd/properties.dtd\">\r\n<properties>\r\n<comment>uniCenta oPOS</comment>\r\n<entry key=\"location\">0</entry>\r\n<entry key=\"activecash\">eb15f787-ace3-4936-919d-2303ae3291c7</entry>\r\n</properties>\r\n'),('7','coin.20',1,'‰PNG\r\n\Z\n\0\0\0\rIHDR\0\0\0@\0\0\0?\0\0\0PÎÊ\0\0\0gAMA\0\0±üa\0\0\0	pHYs\0\0.\"\0\0.\"ªâİ’\0\0\0\ZtEXtSoftware\0Paint.NET v3.5.100ôr¡\0\0\"iIDATx^µ[÷s]çq…ì?$3É™qg’íÈÙ’œq“¬fÉT¡D‘\"ÅN`E!\nÑA…hDï½÷Ş{ï½w\0‰^ˆÍ9ûxišCf@GÁÌûŞÃ»÷~»ßÙ³g÷ûŞ\"böCş˜½ñÆzğ÷şµñÙ~ô#ı?¿o¼~òä‰Ùüc½†‡ñ¹1¾çïõü˜kïoŒíÙ‡ıg>hww×Œg\ZÈ{ïïï?{ıü³ŒÿŸíííë÷y-Ïü?¯İÛÛ{éõüÿwØƒ